  input: '"TEXT","F3XA","C00346635","In June, 2006 the RMC commissioned a poll, a
    portion of which was subsequently used for a GOTV mailer (IE) that was reported
    to the FEC (24 hour report) dated 7/31/2006. The original poll had 38 questions
    at a cost of $104.86 per question. A total of 8 questions were used in the GOTV
    mailer so the RMC PAC has reimbursed the RMC at 50% of the original cost - a valuation
    the FEC has established for data beatween 16 and 60 days old. This  reimbursement  totals
    $419.44 and has been charged as a general operating expense.  In addition, the
    RMC, as a part of its membership development efforts for 2006 purchased a targeted
    list of 7000 names - the fair market value of which has been established at $.10
    per name. This list was subsequently used for a phone bank (IE) and reported in
    a 24 hour report to the FEC dated August 8, 2006.  The RMC PAC has reimbursed
    the RMC, $700 for the use of the list and charged this expense to general operating
    expenditures.  The total reimbursement for these two expenses was $1,119.44.    Respectfully
    submitted,  Susan B. Walrich, Treasurer    Republican Majority for Choice PAC"'
